import './App.css';
import Leftbar from './components/Leftbar';
import Cover from "./components/Cover";
import { Container, Row } from "react-bootstrap";
import "./style.css"

function App() {
  return (
    <div className="App">
      <Container>
      <Row>
      <Leftbar />
      <Cover />
      </Row>
      </Container>
    </div>
  );
}

export default App;
